class Solution:
    def isPossibleToCutPath(self, grid: List[List[int]]) -> bool:
        """BFS

        If the next level has only one node and it's not the terminating level,
        return False. We have to do it two rounds, top left to bottom right and
        bottom right to top left, because trial-and-error

        Note that the queue has to be a set to avoid duplicates.

        O(N)
        """
        M, N = len(grid), len(grid[0])
        if M == N == 1:  # edge case, because we cannot take even one step
            return False
        # Top left to bottom right
        queue = set([(0, 0)])
        while queue:
            tmp = set()
            for i, j in queue:
                for di, dj in [(0, 1), (1, 0)]:
                    ni, nj = i + di, j + dj
                    if 0 <= ni < M and 0 <= nj < N and grid[ni][nj] == 1:
                        tmp.add((ni, nj))
            if (M - 1, N - 1) in tmp:
                break
            if len(tmp) <= 1:
                return True
            queue = tmp
        # Bottom right to top left
        queue = set([(M - 1, N - 1)])
        while queue:
            tmp = set()
            for i, j in queue:
                for di, dj in [(0, -1), (-1, 0)]:
                    ni, nj = i + di, j + dj
                    if 0 <= ni < M and 0 <= nj < N and grid[ni][nj] == 1:
                        tmp.add((ni, nj))
            if (0, 0) in tmp:
                break
            if len(tmp) <= 1:
                return True
            queue = tmp
        return False


